
############################################################################################################
####### Function: Add Exception to Defender ################################################################
############################################################################################################
function addDefenderException() {
    param (
        [Parameter(Mandatory = $true)]
        [string]$path
    )
    $exclusionCommand = "Add-MpPreference -ExclusionPath `"$path`""
    Invoke-Expression $exclusionCommand
    # Check if the exclusion was added successfully
    if ((Get-MpPreference).ExclusionPath -contains $path) {
        Write-Host "Exclusion added successfully! $path" -ForegroundColor Green
    }
    else {
        Write-Host "Failed to add exclusion." -ForegroundColor Red
    }
}

############################################################################################################
####### Function: Remove Exception from Defender ################################################################
############################################################################################################
function removeDefenderException() {
    param (
        [Parameter(Mandatory = $true)]
        [string]$path
    )
    $exclusionCommand = "Remove-MpPreference -ExclusionPath `"$path`""
    Invoke-Expression $exclusionCommand
    # Check if the exclusion was removed successfully
    if ((Get-MpPreference).ExclusionPath -notcontains $outputExePath) {
        Write-Host "Exclusion removed successfully!" -ForegroundColor Green
    }
    else {
        Write-Host "Failed to remove exclusion." -ForegroundColor Red
    }
}

############################################################################################################
####### Function: Decompress datastring ###### #############################################################
############################################################################################################
function decompressDataString() {
    param (
        [Parameter(Mandatory = $true)]
        [string]$dataString
    )
    $compressed = [System.Convert]::FromBase64String($dataString)
    $initialCapacity = $compressed.Length + 1024
    $ms = New-Object System.IO.MemoryStream -ArgumentList $initialCapacity
    $ms.Write($compressed, 0, $compressed.Length)
    $ms.Position = 0
    $gzip = New-Object System.IO.Compression.GzipStream $ms, ([IO.Compression.CompressionMode]::Decompress)
    $buffer = New-Object byte[](1024)
    $msOutput = New-Object System.IO.MemoryStream
    while (($read = $gzip.Read($buffer, 0, 1024)) -gt 0) {
        $msOutput.Write($buffer, 0, $read)
    }
    $gzip.Close()
    $msOutput.Position = 0
    $thecontent = $msOutput.ToArray()
    return ,$thecontent
}

############################################################################################################
####### Function: Run Assembly in Job  #####################################################################
############################################################################################################

function runAssemblyInJob() {
    param (
        [Parameter(Mandatory = $true)]
        [byte[]]$thecontent,
        [Parameter(Mandatory = $true)]
        [string]$outputFile
    )

    $job = Start-Job -ScriptBlock {
        param($thecontent, $outputFile)
        # $winPEASAssembly = [System.Convert]::FromBase64String($thecontent)
        $wp = [System.Reflection.Assembly]::Load($thecontent)
        [winPEAS.Program]::Main(@("notcolor", "log=$outputFile"))
    } -ArgumentList $thecontent, "$outputFile"
    
    $startTime = Get-Date
    while ((Get-Job -Id $job.Id).State -eq 'Running') {
        Start-Sleep -Seconds 5
        $elapsedTime = New-TimeSpan -Start $startTime -End (Get-Date)
        $progressPercentage = [System.Math]::Min(($elapsedTime.TotalSeconds / 600) * 100, 100)
        $progressStatus = "Currently performing vulnerability scan: {0:N2}%" -f $progressPercentage
        Write-Progress -Activity "Processing please wait..." -Status $progressStatus -PercentComplete $progressPercentage
    }
    
    Wait-Job $job
    Receive-Job $job
    Remove-Job $job
}

############################################################################################################
####### Function: Load Assembly ############################################################################
############################################################################################################
function loadAssembly() {
    param (
        [Parameter(Mandatory = $true)]
        [byte[]]$assembly
    )
    Write-Host "Loading assembly..."
    [System.Reflection.Assembly]::Load($assembly)
    Write-Host "Executing winPEAS..."
    [winPEAS.Program]::Main(@("browserinfo", "notcolor"))
}

############################################################################################################
####### Function: Write to File ############################################################################
############################################################################################################

function writeByteArrayToFile() {
    param (
        [Parameter(Mandatory = $true)]
        $thecontent,
        [Parameter(Mandatory = $true)]
        [string]$outputFile
    )
    $fs = New-Object System.IO.FileStream $outputFile, ([System.IO.FileMode]::Create)
    $bw = New-Object System.IO.BinaryWriter $fs
    $bw.Write($thecontent)
    $bw.Close()
    $fs.Close()
}

##############################################################################################################
####### Function: Delete File  ###############################################################################
##############################################################################################################
function deleteFile() {
    param (
        [Parameter(Mandatory = $true)]
        [string]$file
    )
    if (Test-Path $file) {
        Remove-Item $file
    }
}

